  false,\n\t\"url\": null,\n\t\"notes\": \"Dune features (dune crest and toe elevations)
  and mean-high-water shoreline data for a portion of the New York, Delaware, Maryland,
  Virginia, and North Carolina coastlines, post-Hurricane Sandy (Sandy was an October
  2012 hurricane that made landfall as an extratropical cyclone on the 29th), were
  produced by the U.S. Geological Survey (USGS) from remotely sensed, geographically
  referenced elevation measurements collected by Photo Science and Woolpert using
  using airborne lidar sensors. Binary point-cloud data, as well as digital elevation
  models (DEM), were also produced by Photo Science and Woolpert and are included
  in this Data Series.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
